import React, { useState, useEffect } from "react";
import { useSelector, useDispatch } from "react-redux"
import { useParams } from 'react-router-dom';
import { Row, Col, Container, Form, Card } from 'react-bootstrap';
import Header from '../../components/Header';
import Footer from '../../components/Footer';
import ImageFiller from 'react-image-filler';
import pharmacyService from "../../services/pharmacyService";

function StaffDetails() {
  const { productId } = useParams();
  const [product, setProduct] = useState([]);
  const dispatch = useDispatch();
  const getProductDetails = async () => {
  const data = await pharmacyService.getProductById(productId);
		setProduct(data);
	};
  const { user } = useSelector((state) => state.auth);

  useEffect(() => {
		getProductDetails();
	}, []);

  // const priceFormatter = (number) => {
  //   return number.toLocaleString('en-US');
  // }

  return (
    <>
      <div className="wrapper">
        <Header />
        <Container className="py-5 mt-5">
          <Row className="mt-4">
            <Col className="col-12 col-md-3 col-lg-2">
              <h4 className="text-muted">Filters:</h4>
              <div className="mb-3">
              <Form.Control type="text" placeholder="search" />
              </div>
              <div className="mb-3">
                <Form.Label>By Category</Form.Label>
                <Form.Select aria-label="Default select example">
                  <option>All</option>
                  <option value="1">Personal care</option>
                  <option value="2">Mother baby</option>
                  <option value="3">Vaccines</option>
                  <option value="4">Prescription medicine</option>
                  <option value="5">Home medicines</option>
                  <option value="6">Vitamins & supplements</option>
                </Form.Select>
              </div>

              <div>
                <Form.Label>By Price</Form.Label>  
                <Form.Range />
              </div>
            </Col>
            <Col className="col-12 col-md-9 col-lg-10">
              <Row>
                <Col className="col-12 col-md-6 col-lg-3 mb-4">
                  <Card>
                    <ImageFiller width={250} height={190} />
                    <Card.Body>
                      <div><a className="text-secondary text-decoration-none" href="/#">{ product.description }</a></div>
                      <div className="fw-bold mt-2">UGX { product.price }/- </div>
                      <div className="d-flex justify-content-between mt-3">
                        <div><button type="button" className="btn rounded-5 btn-sm px-3 btn-outline-secondary"><i className="bi bi-cart3 me-1" style={{ "fontSize": '18px' }}></i> Add To cart</button></div>
                        <div>
                          <a className="text-muted fw-bold text-decoration-none" href='/#'><i className="bi bi-heart" style={{ "fontSize": '20px' }}></i></a>
                        </div>
                      </div>
                    </Card.Body>
                  </Card>
                </Col>
              </Row>
            </Col>
          </Row>
        </Container>
        <Footer />
      </div>
    </>
  );
}

export default Pharmacy;
